import React from "react";
import { Link } from "react-router-dom";


const PriceComparison = () => {

  return (
    <div className="container">
      <ul class="nav nav-pills mb-3" id="pills-tab" role="tablist">
        <li class="nav-item" role="presentation">
          <Link to="/">
            <a class="nav-link" id="pills-home-tab" data-toggle="pill" href="#pills-home" role="tab" aria-controls="pills-home" aria-selected="false">Home</a>
          </Link>

        </li>
        <li class="nav-item" role="presentation">
          <a class="nav-link" id="pills-guideline-tab" data-toggle="pill" href="#pills-guideline" role="tab" aria-controls="pills-guideline" aria-selected="false">Guideline</a>
        </li>
        <li class="nav-item" role="presentation">
          <a class="nav-link active" id="pills-priceComparison-tab" data-toggle="pill" href="#pills-priceComparison" role="tab" aria-controls="pills-priceComparison" aria-selected="true">Price Comparison</a>
        </li>
      </ul>
      <div class="tab-content" id="pills-tabContent">
        <div class="tab-pane fade" id="pills-guideline" role="tabpanel" aria-labelledby="pills-guideline-tab">guideline</div>
        <div class="tab-pane fade show active" id="pills-priceComparison" role="tabpanel" aria-labelledby="pills-priceComparison-tab">priceComparison</div>
      </div>
    </div>

  );
};

export default PriceComparison;
